public int instrumentedSort(int[] nums){ 
  int comps = 0; 
  int lim1 = nums.length - 1; 
  int lim2 = nums.length; 
  for(int i = 0; i < lim1; i++){ 
    int min = i; 
    for(int j = i + 1; j < lim2; j++){ 
      comps++; 
      if( nums[j] < nums[min] ) 
        min = j; 
    } 
    int temp = nums[i]; 
    nums[i] = nums[min]; 
    nums[min] = temp; 
  } 
  return comps; 
} 
